import { useEffect, useState } from "react";
const ModalCategory = (props) => {
  const [icon, setIcon] = useState(null);

  useEffect(() => {
    if (icon != null) {
      props.setIcon(icon);
      props.setState(false);
    }
  }, [icon]);

  return (
    <div className="modalContainer">
      <div className="modalBody">
        <div className="closeBtn">
          <img
            className="
            cancelIcon"
            src="images/cancel.svg"
            alt=""
            onClick={() => {
              props.setState(false);
            }}
          />
        </div>
        <h5>Добавить Иконку</h5>
        {/* Food & drinks */}
        <div className="categoriesImages">
          <div>
            <h3>Еда & Напитки</h3>
            <div className="categoryImg">
              <div>
                <img
                  src="images/food&drinks/supermarket.png"
                  value={icon}
                  onClick={(e) => {
                    setIcon(e.target.src);
                  }}
                />
                <p>Продукты</p>
              </div>
              <div className="imagesByCategory">
                <img
                  src="images/food&drinks/steak.png"
                  value={icon}
                  onClick={(e) => {
                    setIcon(e.target.src);
                  }}
                />
                <p>Рестораны</p>
              </div>
              <div>
                <img
                  src="images/food&drinks/juice.png"
                  value={icon}
                  onClick={(e) => {
                    setIcon(e.target.src);
                  }}
                />
                <p>Напитки</p>
              </div>
              <div>
                <img
                  src="images/food&drinks/muffin.png"
                  value={icon}
                  onClick={(e) => {
                    setIcon(e.target.src);
                  }}
                />
                <p>Десерты</p>
              </div>
              <div className="imagesByCategory">
                <img
                  src="images/food&drinks/delivery.png"
                  value={icon}
                  onClick={(e) => {
                    setIcon(e.target.src);
                  }}
                />
                <p>Доставка</p>
              </div>
            </div>
          </div>
        </div>
        {/* Housing */}
        <div className="categoriesImages">
          <div>
            <h3>Жилье & Траспорт</h3>
            <div className="categoryImg">
              <div>
                <img
                  src="images/housing/rent.png"
                  value={icon}
                  onClick={(e) => {
                    setIcon(e.target.src);
                  }}
                />
                <p>Аренда</p>
              </div>

              <div>
                <img
                  className="smallImg"
